import Button from "./Button";
import styles from "./App.module.css"
import { useState, useEffect } from "react";

function App() {
  const [loading, setLoading] = useState(true);
  useEffect(() => {
    fetch("https://api.coinpaprika.com/v1/tickers?limit=10").then((response) => response.json()).then((response) => console.log(response));
  }, []);
  return (
    <div>
      <h1>Coin Prices!</h1>
      {loading ? <strong>LOADING...</strong> : null}
    </div>
  );
}

export default App;
